goog.provide("goog.userAgent.jscriptTest");goog.setTestOnly("goog.userAgent.jscriptTest");goog.require("goog.testing.jsunit");goog.require("goog.userAgent.jscript");function ScriptEngine(){return"JScript"}function ScriptEngineMajorVersion(){return 1}function ScriptEngineMinorVersion(){return 2}function ScriptEngineBuildVersion(){return 3456}function testHasJscript(){assertTrue("Should have jscript",goog.userAgent.jscript.HAS_JSCRIPT)}function testVersion(){assertEquals("Version should be 1.2.3456","1.2.3456",goog.userAgent.jscript.VERSION)}function testIsVersion(){assertTrue("Should be version 1.2.3456 or larger",goog.userAgent.jscript.isVersion("1.2.3456"));assertTrue("Should be version 1.2 or larger",goog.userAgent.jscript.isVersion("1.2"));assertFalse("Should not be version 8.9 or larger",goog.userAgent.jscript.isVersion("8.9"))}